    false,nt"url": null,nt"notes": "The Lower Souris Migratory Waterfowl Refuge
    (now known as the J. Clark Salyer National Wildlife Refuge) is located just south
    of the Canadian border in North Dakota. The refuge was established and constructed
    by the CCC in 1935 to restore waterfowl habitat. This report gives an overview of
    events taking place on the refuge in July of 1937. Development on the refuge in
    July was productive due to mild temperatures. Rainfall has been about average, so
    that crop and cover conditions were fair to good. Hay continues to be an area of
    dispute and conflict of interest. Hopes are high to finish Dam 357 by the first
    frost. Other projects included raising and sloping the State Highway 5 section that
    runs through the refuge, putting in fire line, lookout tower construction, truck
    trail development, seed collection and harvest and fencing. Nesting studies were
    conducted but not completed. The report concludes with a photographs section.",nt"owner_org":
